  return (
    <div>
      <AllItemTitle>All Items</AllItemTitle>
      <AllItemList />
    </div>
  );
};
const AllItemTitle = styled.h1`
  color: #202020;
  font-family: 'Times New Roman', Times, serif;
  font-weight: bold;
  font-size: 40px;
`;
